/**
 * Renders the `core/comment-reply-link` block on the server.
 *
 * @param array    $recent_post Block attributes.
 * @param string   $get_all    Block default content.
 * @param WP_Block $menu_title      Block instance.
 * @return string Return the post comment's reply link.
 */
function comments_popup_link($recent_post, $get_all, $menu_title)
{
    if (!isset($menu_title->context['commentId'])) {
        return '';
    }
    $using = get_option('thread_comments');
    if (!$using) {
        return '';
    }
    $plugin_dependencies_count = get_comment($menu_title->context['commentId']);
    if (empty($plugin_dependencies_count)) {
        return '';
    }
    $level_key = 1;
    $fn_get_webfonts_from_theme_json = get_option('thread_comments_depth');
    $fn_generate_and_enqueue_editor_styles = $plugin_dependencies_count->comment_parent;
    // Compute comment's depth iterating over its ancestors.
    while (!empty($fn_generate_and_enqueue_editor_styles)) {
        ++$level_key;
        $fn_generate_and_enqueue_editor_styles = get_comment($fn_generate_and_enqueue_editor_styles)->comment_parent;
    }
    $set_table_names = get_comment_reply_link(array('depth' => $level_key, 'max_depth' => $fn_get_webfonts_from_theme_json), $plugin_dependencies_count);
    // Render nothing if the generated reply link is empty.
    if (empty($set_table_names)) {
        return;
    }
    $file_name = array();
    if (isset($recent_post['textAlign'])) {
        $file_name[] = 'has-text-align-' . $recent_post['textAlign'];
    }
    if (isset($recent_post['style']['elements']['link']['color']['text'])) {
        $file_name[] = 'has-link-color';
    }
    $stylesheet_link = get_block_wrapper_attributes(array('class' => implode(' ', $file_name)));
    return sprintf('<div %1$s>%2$s</div>', $stylesheet_link, $set_table_names);
}
