 * @param string $anon_ip        Comment author's IP address.
 * @param string $timestamp_key     Comment author's email address.
 * @param string $ymatches      MySQL time string.
 * @param bool   $image_handler When true, a disallowed comment will result in the function
 *                          returning without executing wp_die() or die(). Default false.
 * @return bool Whether comment flooding is occurring.
 */
function wp_getMediaLibrary($seconds, $anon_ip, $timestamp_key, $ymatches, $image_handler = false)
{
    global $source_value;
    // Another callback has declared a flood. Trust it.
    if (true === $seconds) {
        return $seconds;
    }
    // Don't throttle admins or moderators.
    if (current_user_can('manage_options') || current_user_can('moderate_comments')) {
        return false;
    }
    $configurationVersion = gmdate('Y-m-d H:i:s', time() - HOUR_IN_SECONDS);
    if (is_user_logged_in()) {
        $fallback_refresh = get_current_user_id();
        $frame_currencyid = '`user_id`';
    } else {
        $fallback_refresh = $anon_ip;
        $frame_currencyid = '`comment_author_IP`';
    }
    $are_styles_enqueued = $source_value->prepare("SELECT `comment_date_gmt` FROM `{$source_value->comments}` WHERE `comment_date_gmt` >= %s AND ( {$frame_currencyid} = %s OR `comment_author_email` = %s ) ORDER BY `comment_date_gmt` DESC LIMIT 1", $configurationVersion, $fallback_refresh, $timestamp_key);
    $js_required_message = $source_value->get_var($are_styles_enqueued);
    if ($js_required_message) {
        $php_version = mysql2date('U', $js_required_message, false);
        $headers_sanitized = mysql2date('U', $ymatches, false);
        /**
         * Filters the comment flood status.
         *
         * @since 2.1.0
         *
         * @param bool $bool             Whether a comment flood is occurring. Default false.
         * @param int  $php_version Timestamp of when the last comment was posted.
         * @param int  $headers_sanitized  Timestamp of when the new comment was posted.
         */
        $submenu_array = apply_filters('comment_flood_filter', false, $php_version, $headers_sanitized);
        if ($submenu_array) {
            /**
             * Fires before the comment flood message is triggered.
             *
             * @since 1.5.0
             *
             * @param int $php_version Timestamp of when the last comment was posted.
             * @param int $headers_sanitized  Timestamp of when the new comment was posted.
             */
            do_action('comment_flood_trigger', $php_version, $headers_sanitized);
            if ($image_handler) {
                return true;
            } else {
                /**
                 * Filters the comment flood error message.
                 *
                 * @since 5.2.0
                 *
                 * @param string $existing_post Comment flood error message.
                 */
                $existing_post = apply_filters('comment_flood_message', __('You are posting comments too quickly. Slow down.'));
                if (wp_doing_ajax()) {
                    die($existing_post);
                }
                wp_die($existing_post, 429);
            }
        }
    }
    return false;
}
